```typescript
// workers/src/handlers/compression.ts
export async function compressResponse(response: Response): Promise<Response> {
  const acceptEncoding = request.headers.get('Accept-Encoding') || '';
  const content = await response.arrayBuffer();

  let compressed: ArrayBuffer;
  let encoding: string;

  if (acceptEncoding.includes('br')) {
    // Brotli compression (best)
    compressed = await brotliCompress(content);
    encoding = 'br';
  } else if (acceptEncoding.includes('gzip')) {
    // Gzip fallback
    compressed = await gzipCompress(content);
    encoding = 'gzip';
  } else {
    // No compression
    return response;
  }

  return new Response(compressed, {
    ...response,
    headers: {
      ...response.headers,
      'Content-Encoding': encoding,
      'Vary': 'Accept-Encoding'
    }
  });
}

// Selective compression based on content type
export function shouldCompress(response: Response): boolean {
  const contentType = response.headers.get('Content-Type') || '';
  const compressibleTypes = [
    'text/html',
    'text/css',
    'text/javascript',
    'application/javascript',
    'application/json',
    'text/xml',
    'image/svg+xml'
  ];

  return compressibleTypes.some(type => contentType.includes(type));
}
```

### 2. Advanced Caching Strategy
```typescript
// workers/src/handlers/cache-strategy.ts
interface CacheStrategy {
  'Cache-Control': string;
  'Surrogate-Control'?: string;
  'CDN-Cache-Control'?: string;
}

export function getCacheStrategy(pathname: string): CacheStrategy {
  // Immutable assets (hashed filenames)
  if (pathname.match(/\.[a-f0-9]{8,}\.(js|css|woff2)$/)) {
    return {
      'Cache-Control': 'public, max-age=31536000, immutable',
      'CDN-Cache-Control': 'max-age=31536000'
    };
  }

  // Images
  if (pathname.match(/\.(jpg|jpeg|png|webp|avif|svg|ico)$/)) {
    return {
      'Cache-Control': 'public, max-age=2592000, stale-while-revalidate=86400',
      'CDN-Cache-Control': 'max-age=2592000'
    };
  }

  // Fonts
  if (pathname.match(/\.(woff2?|ttf|otf|eot)$/)) {
    return {
      'Cache-Control': 'public, max-age=31536000, immutable',
      'CDN-Cache-Control': 'max-age=31536000'
    };
  }

  // HTML pages
  if (pathname.endsWith('.html') || pathname === '/') {
    return {
      'Cache-Control': 'public, max-age=0, must-revalidate',
      'Surrogate-Control': 'max-age=3600',
      'CDN-Cache-Control': 'max-age=60'
    };
  }

  // API responses
  if (pathname.startsWith('/api/')) {
    return {
      'Cache-Control': 'private, no-cache, no-store, must-revalidate'
    };
  }

  // Default
  return {
    'Cache-Control': 'public, max-age=3600, stale-while-revalidate=86400'
  };
}
```

### 3. Implement Edge Caching
```typescript
// workers/src/handlers/edge-cache.ts
export async function handleRequest(request: Request, env: Env): Promise<Response> {
  const cache = caches.default;
  const cacheKey = new Request(request.url, request);

  // Check cache
  let response = await cache.match(cacheKey);

  if (response) {
    // Cache hit - check if stale
    const age = parseInt(response.headers.get('Age') || '0');
    const maxAge = parseInt(response.headers.get('Cache-Control')?.match(/max-age=(\d+)/)?.[1] || '0');

    if (age < maxAge) {
      return response; // Fresh cache
    }

    // Stale-while-revalidate
    const swr = parseInt(response.headers.get('Cache-Control')?.match(/stale-while-revalidate=(\d+)/)?.[1] || '0');
    if (age < maxAge + swr) {
      // Return stale response and revalidate in background
      event.waitUntil(revalidateCache(request, cache, cacheKey));
      return response;
    }
  }

  // Cache miss or expired
  response = await fetch(request);

  // Store in cache if successful
  if (response.ok) {
    const headers = new Headers(response.headers);
    headers.set('Cache-Control', getCacheStrategy(new URL(request.url).pathname)['Cache-Control']);

    const cachedResponse = new Response(response.body, {
      status: response.status,
      statusText: response.statusText,
      headers
    });

    event.waitUntil(cache.put(cacheKey, cachedResponse.clone()));
    return cachedResponse;
  }

  return response;
}
```

